import React from 'react';
import styles from './OrderTable.module.scss';

const OrderTable = () => {
    return (
        <div className={styles.orderTable}>
            <div className={styles.tableHeader}>
                <div>
                    <span>Количество</span>
                </div>
                <div>
                    <span>Норер цвета</span>
                </div>
            </div>

            <div>
                <div>
                    <span>2</span>
                </div>

                <div>
                    <span>1234</span>
                </div>
            </div>
        </div>
    );
};

export default OrderTable;
